import React, { useState, useEffect } from "react";

import { Meta } from "../layout/Meta";
import { Main } from "../templates/Main";
import { Line } from "react-chartjs-2";
import { scenarioOne, scenarioTwo, scenarioThree } from "../utils/chartInfo";

const options = {
  title: {
    display: true,
    text: "BAC Analysis - Robert Cannon M.D.",
    fontSize: 24,
    fontFamily: "'Helvetica'",
  },
  scales: {
    xAxes: [
      {
        scaleLabel: {
          display: true,
          labelString: "Known Times (AM)",
        },
        ticks: {
          callback: function (value: String, index, values) {
            if (value === "2:58 AM") {
              return value;
            }
          },
        },
      },
    ],
    yAxes: [
      {
        scaleLabel: {
          display: true,
          labelString: "Blood Alcohol Concentration (g/ml)",
        },
        ticks: {
          callback: function (value, index, values) {},
        },
      },
    ],
  },
};

const initialData = {
  labels: [
    "(time unknown)",
    "12:42 AM",
    "(time unknown)",
    "2:58 AM",
    "(time unknown)",
    "(time unknown)",
  ],
  datasets: [
    {
      data: [null, null, null, 0.16, null, null],
      label: "Genesis Petrillo",
      backgroundColor: "#374151",
      borderColor: "#374151",
      fill: false,
    },
  ],
};

const Index = () => {
  const applyScenarioOne = () => {
    let updatedDatasets = [...initialData.datasets, scenarioOne];
    setData({ ...data, datasets: updatedDatasets });
  };

  const [data, setData] = useState(initialData);

  useEffect(() => {
    // only add user preferences if the user has logged in
    console.log("data has changed");
  }, [data.datasets]);

  return (
    <Main
      meta={
        <Meta
          title="Cannon Demonstrative"
          description="The demonstrative for Dr. Robert Cannon - Gardner Consulting."
        />
      }
    >
      <div className="m-20">
        <Line data={data} options={options}></Line>
        <button onClick={() => applyScenarioOne()}>Click me</button>
      </div>
      <div></div>
    </Main>
  );
};

export default Index;
